  "id_str" : "1048572542338850816",
  "in_reply_to_user_id" : 5703342,
  "text" : "\"So, in honor of Reality Bites's birthday and my long-deceased naivet\u00E9, let's take a look back at all the garbage words we thought were profound when we were 12. (Spoiler: Most of them come out of Troy.)\"",
  "id" : 1048572542338850816,
