  "id_str" : "1048572479260643329",
  "in_reply_to_user_id" : 5703342,
  "text" : "\"But oh my GOD, as a '90s teen did I ever want to sit on a fourth-hand couch in a smoke-choked apartment and have these conversations and then eventually get \"picked\" by an emotionally abusive band guy!!!\"",
