  "id_str" : "1048572111789293569",
  "in_reply_to_user_id" : 5703342,
  "text" : "\"And you're not going to trick me into wanting to be Lelaina by dangling that Ethan Hawke-shaped carrot in my face, because Troy is a petroleum-jelly-dipped turd and I make plenty of those already with my butt. Minus the petroleum.\"",
